INSERT INTO `berita` (`idberita`, `title`, `content`, `image`, `postdate`, `author`) VALUES
(34, 'Pemerintah menanggung iuran JKN bagi masyarakat miskin dan tidak mampu', 'Pemerintah menanggung iuran JKN bagi masyarakat miskin dan tidak mampu, yang jumlahnya mencapai 86,4 juta orang, termasuk 4.192.297 orang di Propinsi Sumatera Utara. Kelompok ini disebut dengan Penerima Bantuan Iuran (PBI)', '', '2014-03-20 00:00:00', 'admin'),
(36, 'Setiap Orang Perlu Jaminan Kesehatan, Karena Setiap Orang Berisiko Jatuh Sakit', 'JKN adalah program jaminan sosial kesehatan nasional, yang diamanatkan dalam Undang-Undang No. 40 tahun 2004 tentang Sistem Jaminan Sosial Nasional (SJSN). Jaminan Kesehatan ini mengacu pada prinsip asuransi sosial, yaitu: peserta wajib membayar iuran yang cukup terjangkau, dapat dilayani di semua wilayah Indonesia\r\n', '', '2014-03-20 00:00:00', 'admin'),
(37, 'GERBANGMAS : GERAKAN MASIF DAN TERINTEGRASI', 'GERAKAN MASIF DAN TERINTEGRASI\r\n\r\nREFORMASI BIROKRASI:\r\nRestrukturisasi\r\nRefungsionalisasi\r\nRevitaslisasi\r\nGEMAS (GENERASI EMAS PAPUA):\r\nJaminan Seribu Hari Pertama Kehidupan (1000 HPK)\r\nTuntas Buta Aksara\r\nWajib Belajar 9 tahun\r\nPrestasi Olah rage, seni dan budaya\r\nPengembangan daya saing Papua\r\nPEMBERDAYAAN EKONOMI:\r\nProspek (Prog Strategis Pemb. Ek. &Kelembagaan Kampung)\r\nPengwilayahan Komoditas\r\nTanam ,petik, olah, jual\r\nINFRASTRUKTUR & PRASARANA DASAR:\r\nTransportasi (Darat, Laut, Udara,ASDP)\r\nPenyediaan Energi Listrik\r\nPerumahan Layak Huni\r\nPenyediaan Air Bersih', 'gerbangmas.jpg', '2016-05-19 02:58:53', 'admin'),
(38, 'Apa itu Pusdalisbang ?', 'Apa itu Pusdalisbang ?\r\nPusdalisbang (Pusat Data dan Analisa Pembangunan) adalah Wadah yang berfungsi sebagai pengelola data dan informasi pembangunan daerah. Selain itu Pusat Data dan Analisa Pembangunan berfungsi untuk :\r\n\r\nMenjembatani jaringan-jaringan dengan pemangku kepentingan pembangunan\r\nMendukung dipergunakannya data dan informasi tersebut oleh pemerintah daerah untuk memperbaiki kualitas pengelolaan keuangan daerah\r\n\r\nMendorong pengembangan kapasitas dan secara proaktif menyebarkan data dan informasi (terutama dokumen-dokumen perencanaan dan penganggaran) kepada publik dan pemerintah.', '', '2016-05-18 10:38:44', 'admin'),
(45, 'Diskusi Bersama Bank Indonesia dan Badan Pusat Statistik Provinsi Papua', '<p>Diskusi bersama Bank Indonesia dan Badan Pusat Statistik Provinsi Papua Tentang Pertumbuhan Ekonomi Papua, Angka Kemiskinan dan Indeks Pembangunan Manusia di Papua, Pada Tanggal 09 Februari 2017 Kamis Kemarin di Ruang Rapat BAPPEDA Provinsi Papua.</p>', 'kamis.jpg', '2017-02-11 01:20:13', 'admin');
