(2, 'Reynold Andika', 'woopy_woopy@yahoo.com', 'Kami dari Woopy Konveksi, sebuah konveksi kecil asal Medan ingin meminta bantuan informasi dari Anda, karena kami telah mengalami indikasi penipuan dari salah satu Wali Data bidang Perkebunan atas nama Bpk. Billy E. Tokoro. yakni terkait tidak dilakukannya pelunasan terhadap pemesanan Seragam Penas Papua 2017 yang sudah kami produksi dan diterima oleh pemesan.\r\nSaat ini kami kesulitan berkomunikasi dengan beliau. Kami juga memiliki bukti2 pemesanan, percakapan dan pengiriman seragam.\r\nJika memungkinkan, mohon bantuannya untuk menjadi pihak mediasi.\r\n\r\nTerima kasih.', '2017-06-04 11:35:39'),
(3, 'Imam Abadi', 'imam.abadi09@gmail.com', 'Selamat siang.\r\nPeta wilayah lahan milik pemerintahan Papua bisa saya dapatkan dimana.\r\n\r\nTerimakasih\r\n', '2017-08-09 14:26:09'),
(4, 'MAX BEROTABUI, SE', 'max.bero30@gmail.com', 'Tolong Kirimkan Format data ( WALI DATA ) ke Dinas Pemberdayaan Perempuan, Perlindungan Anak dan KB Prov papua', '2017-09-29 00:38:15'),
(5, 'Reynoldy FR. Mandey', 'reynoldymandey@gmail.com', 'To Admin :\r\nTolomg di jelaskan maksud dari pada "Tingkat Ketersediaan Informasi Jalan dan Jembatan" sesuai dengan isian format .xlsx pada isian data untuk di upload', '2017-10-07 10:11:50'),
(6, 'brampi jitmau wali data b', 'jitmau.brampi@gmail.com', 'kita mau input data cuma elemen2 data belum muncul di tampilan layar pada saat masuk ...makasih lg...', '2017-12-07 12:21:56'),
(7, 'BETTY SIRAIT', 'beth812041@gmail.com', 'Bisa saya minta nomor telepon Dinas PU Kab. Intan Jaya Distrik Sugapa? Terima kasih sebelumnya', '2018-03-05 23:42:10'),
(8, 'EDISON KAWER', 'edisinkawer@gmail.com', 'kalau mau lihat data elemen pada aplikasi di buka pada menu apa ...', '2018-03-07 16:10:56'),
(9, 'suyadi', 'soeyadiadie@gmail.com', 'mohon di emailkan panduan aplikasi pengisian data. terimakasih, walidata ptun\r\n', '2018-03-07 16:34:53'),
(10, 'Welly o koibur', 'wellyoktofianuskoiburg@ma', 'Saya kontraktor di kab.biak numfor. CV.KEMBAR\r\n', '2018-05-27 17:09:58'),
(11, 'Welly o koibur', 'wellyoktofianuskoiburg@ma', 'Saya minta tolong petunjuk bagaimn saya bisa dapat pekerjaan di kab.biak numfor yang adil,karna slama ini kami asli papua tdk merasakan dana odsus yg adil. Maksi', '2018-05-27 17:14:37');
